package br.com.restaurante.model;import java.util.List;@SuppressWarnings("serial")public class FuncaoModel extends BaseModel implements CrudModel<FuncaoModel> {	private String descricao;	private Boolean flagPermissaoLogin;	private List<FuncaoOrigemModel> funcaoOrigens;	private MenuModel menuInicial;	private List<UsuarioFuncaoModel> usuariosFuncoes;	private String css;	private List<FuncaoModel> historico;	public FuncaoModel() {	}	public FuncaoModel(Long id) {		super();		this.id = id;	}	public String getDescricao() {		return descricao;	}	public void setDescricao(String descricao) {		this.descricao = descricao;	}	public Boolean getFlagPermissaoLogin() {		return flagPermissaoLogin;	}	public void setFlagPermissaoLogin(Boolean flagPermissaoLogin) {		this.flagPermissaoLogin = flagPermissaoLogin;	}	public List<FuncaoOrigemModel> getFuncaoOrigens() {		return funcaoOrigens;	}	public void setFuncaoOrigens(List<FuncaoOrigemModel> funcaoOrigens) {		this.funcaoOrigens = funcaoOrigens;	}	public MenuModel getMenuInicial() {		return menuInicial;	}	public void setMenuInicial(MenuModel menuInicial) {		this.menuInicial = menuInicial;	}	public List<UsuarioFuncaoModel> getUsuariosFuncoes() {		return usuariosFuncoes;	}	public void setUsuariosFuncoes(List<UsuarioFuncaoModel> usuariosFuncoes) {		this.usuariosFuncoes = usuariosFuncoes;	}	public String getCss() {		return css;	}	public void setCss(String css) {		this.css = css;	}	public List<FuncaoModel> getHistorico() {		return historico;	}	public void setHistorico(List<FuncaoModel> historico) {		this.historico = historico;	}}